            <label htmlFor={`child-age-${index}`}>Date de naissance de l'enfant:</label>
            <input
              type="date"
              id={`child-age-${index}`}
              name={`age-${index}`}
              value={child.age || ''}
              onChange={(event) => handleChange(event, index)}
            />
          </div> */}
        {/* ))} */}
        {/* <button type="button" onClick={handleAddChild}>
          +
        </button> */}
        <button type="submit">SUIVANT</button>
      </form>
    </div>
  );
}
